@Plinio Barra.  The cleanest energy ever?  Surely you jest?   Nuclear power plants produce tons of high level radioactive waste every year and much more low level waste which must to stored safely, but no one wants in their neighborhood.  

Nuclear power plants are also notorious for really nasty and catastrophic melt downs releasing high level radiation into the atmosphere.  Chernobyl and Fukashima come to mind.  Three Mile Island also had a partial meltdown which was not as extreme as the first 2, but it still had to be decommissioned it was such a mess.  

The renewable resources like wind and solar are no where in that category of risk to the environment.
